(16, 'pay', '/pay', NULL, NULL, '<h2>Pay</h2>\n<? if ($order->payment_processed()): ?>\n<p>This order is already paid. Thank you!</p>\n<? else: ?>\n<p>\nOrder #<?= $order->id ?><br/>\nTotal: <?= format_currency($order->total) ?><br/>\nPayment method: <?= h($payment_method->name) ?>\n</p>\n<? if ($order->payment_method->has_payment_form()): ?>\n<? $payment_method->render_payment_form($this) ?>\n<? else: ?>\n<? if ($message = $payment_method->pay_offline_message()): ?>\n<p><?= h($message) ?></p>\n<? else: ?>\n<p>Payment method "<?= h($payment_method->name) ?>" has no payment form.</p>\n<? endif ?>\n<? endif ?>\n<? endif ?>', 1, NULL, '2013-02-27 00:48:55', NULL, 2, 'shop:pay', NULL, NULL, 'everyone', NULL, 'any', 0, NULL, NULL, NULL, 1, NULL, 16, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 'pay', 1),
(6, 'Shipping  And Returns', '/shipping-and-returns', NULL, NULL, '<div class="product-container">\n	\n	<img src="/pcm.co.nz/store/themes/default/resources/images/Books_background-box.png" id="shipping-background" />\n	<h2 id="shipping-title"> Shipping And Returns </h2>\n	\n	<p class="shipping-copy"> Shipping </br></p>\n	<p class="shipping-copy"> Shipping text to go in here n eleifend molestie erat. Nullam rhoncus est vitae sapien lacinia dignissim. Vestibulum faucibus lorem quis turpis consectetur viverra. Aliquam semper turpis eu tortor luctus at ornare sapien adipiscing. Donec non nunc sit amet urna suscipit laoreet quis in odio. Cras tempus tempor tellus, et vehicula velit tristique et. </p>\n	\n	<p class="returns-copy"> Returns </p><br>\n	<p class="returns-copy"> Returns text to go in here n eleifend molestie erat. Nullam rhoncus est vitae sapien lacinia dignissim. Vestibulum faucibus lorem quis turpis consectetur viverra. Aliquam semper turpis eu tortor luctus at ornare sapien adipiscing. Donec non nunc sit amet urna suscipit laoreet quis in odio. Cras tempus tempor tellus, et vehicula velit tristique et. </p>\n</div>', 2, 1, '2013-02-13 03:25:24', '2013-03-08 00:50:38', 1, 'Custom', NULL, NULL, 'everyone', NULL, 'any', 0, NULL, NULL, NULL, 1, NULL, 6, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 'shipping_and_returns', 1),
(18, 'success', '/success', NULL, NULL, '<div id="success">\n<? if (!$order): ?>\n<h2>Order not found.</h2>\n<? elseif (!$payment_processed): ?>\n<h2>This order is not paid.</h2>\n<? else: ?>\n<img src="/store/themes/default/resources/images/pcm_invoice_nz_header.png" class="invoice-header"/>\n<h2 id="success-heading">Thank you!</h2>\n<p id="sucess-ordernum">Order # <?= $order->id ?><br/>Order Date: <?= h($order->order_datetime->format(''%x'')) ?></p>\n<table>\n<tr id="success-table-headings">\n<th id="success-table-heading-name">Items</th>\n<th id="success-table-heading-price">Price</th>\n<th id="success-table-heading-quantity">Quantity</th>\n<th id="success-table-heading-total">Total</th>\n</tr>\n<? foreach ($items as $item): ?>\n<tr id="success-table-row">\n<td id="success-product-name"><?= $item->output_product_name() ?></td>\n<td id="success-price"><?= format_currency($item->single_price) ?></td>\n<td id="success-quantity"><?= $item->quantity ?></td>\n<th id="success-total"><?= format_currency($item->subtotal) ?></th>\n</tr>\n\n<? endforeach ?>\n</table>\n\n<p id="success-bottom">Subtotal: <?= format_currency($order->subtotal) ?><br/><br/>\n\n \nShipping: <?= format_currency($order->shipping_quote) ?><br/><br/>\n \n<? foreach ($order->list_shipping_taxes() as $tax): ?>\nShipping tax (<?= ($tax->name) ?>): <?= format_currency($tax->total) ?><br/><br /><br/>\n<? endforeach ?> \n</p>\n<p>Total: <?= format_currency($order->total) ?></p>\n<? endif ?>\n\n <input type="button" value="Print this page" id="print-button" onclick="printpage()" />\n</div>', 1, 1, '2013-04-15 03:47:23', '2013-04-21 22:09:42', 1, 'shop:payment_receipt', NULL, NULL, 'everyone', NULL, 'any', 0, NULL, NULL, NULL, 1, NULL, 18, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 'success', 1),
(12, 'products', '/products', NULL, NULL, '<img src="/store/themes/default/resources/images/books-rollover.png" id="books-rollover" />\n\n<? if ($product_unavailable): ?>\n		<h2 id="prod-not-found">We are sorry, product unavailable.</h2>\n		<? elseif(!$product): ?>\n		<h2 id="prod-not-found">We are sorry, product not found.</h2>\n		<? else: ?>\n		\n		\n		<div class="product-container">\n	\n	<h2 class="product-title"> <?= $product->name ?> </h2> 	\n	\n	<p class="product-price">Price: $<?= $product->price ?></p>\n	\n	\n	<p class="product-text"><?= h($product->short_description) ?></p>\n	<p><?=($product->description) ?></p>\n	\n	<? foreach ($product->images as $image): ?>\n		<img src="<?= $image->getThumbnailPath(355, 355) ?>" class="book-image"/>\n	<? endforeach ?>\n\n	\n	<?= open_form() ?>\n    	\n     	<input type="button" id="buy-now-product" value="" name=""  onclick="$(this).getForm().sendRequest(''add_and_tocart'')"  />\n      \n\n      \n	<?= close_form() ?>\n	\n	<div id="product_message">\n  	<?= flash_message() ?>\n	</div>​\n	\n</div>\n		\n<? endif ?>', 1, 1, '2013-02-25 21:14:11', '2013-04-19 04:16:14', 4, 'shop:product', NULL, 'function add_and_tocart($controller)\n{\n// Call the default Add to Cart handler\n$controller->exec_action_handler(''shop:on_addToCart'');\n// Redirect to the checkout page\nPhpr::$response->redirect(root_url(''/cart''));\n}', 'everyone', NULL, 'any', 0, NULL, NULL, NULL, 1, NULL, 12, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 'products', 1),
(17, 'unsuccessful', '/unsuccessful', NULL, NULL, '<p> I''m sorry the payment was denied </p>', 1, 1, '2013-03-01 00:42:45', '2013-04-15 01:32:44', 1, 'Custom', NULL, NULL, 'everyone', NULL, 'any', 0, NULL, NULL, NULL, 1, NULL, 17, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 'unsuccessful', 1),
(13, 'cart', '/cart', NULL, NULL, '<div id="cart">\n\n\n<?= open_form() ?>\n    <div id="cart_partial">\n      <? $this->render_partial(''shop:cart'') ?>\n    </div>\n<?= close_form() ?>\n </div>', 1, 1, '2013-02-25 22:26:26', '2013-04-18 23:44:30', 3, 'shop:cart', NULL, NULL, 'everyone', NULL, 'any', 0, NULL, NULL, NULL, 1, NULL, 13, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 'cart', 1),
(14, 'checkout', '/checkout', NULL, NULL, '\n<? if (Shop_Cart::get_item_total_num() != 0): ?>\n<div id="checkout_page">\n<? $this->render_partial(''checkout_partial'') ?>\n</div>\n<? else: ?>\n<p>Your shopping cart is empty.</p>\n<? endif ?>', 1, 1, '2013-02-25 22:37:24', '2013-04-18 23:50:31', 1, 'shop:checkout', NULL, NULL, 'everyone', NULL, 'any', 0, NULL, NULL, NULL, 1, NULL, 14, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 'checkout', 1),
(15, 'category', '/category', NULL, NULL, '<? if (!$category): ?>\n<h2>We are sorry, the specified category not found.</h2>\n<? else: ?>\n	<h2><?= h($category->name) ?></h2>\n	<p class="description"><?= h($category->short_description) ?></p>\n	<img src="<?= $image->getThumbnailPath(100, ''auto'') ?>"/>\n<? endif ?>', 1, 1, '2013-02-25 23:06:04', '2013-02-25 23:41:11', 1, 'shop:category', NULL, NULL, 'everyone', NULL, 'any', 0, NULL, NULL, NULL, 1, NULL, 15, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 'category', 1);
