INSERT INTO `partials` (`id`, `name`, `description`, `html_code`, `created_user_id`, `updated_user_id`, `created_at`, `updated_at`, `file_name`, `theme_id`) VALUES
(1, 'shop:mini_cart', NULL, '<a href="<?= root_url(''/cart'') ?>" class="checkout-button"><img src="/pcm.co.nz/store/themes/default/resources/images/my-cart.png"/> </a>\n\n', 1, 1, '2013-02-25 22:22:16', '2013-02-26 00:10:29', 'shop;mini_cart', 1),
(2, 'shop:cart', NULL, '<table class="cart">\n  <thead>\n  <h2 id="cart-heading"> Shopping-cart </h2>\n    <tr id="cart-row">\n      <th>Item(s)</th>\n      <th class="right">Qty</th>\n      <th class="right">Price</th>\n      <th class="right last" id="cart-total-heading">Total</th>\n    </tr>\n  </thead>\n<tbody>\n  <? $items = Shop_Cart::list_active_items(); ?>\n  <? if ($items): ?>\n    <? foreach ($items as $item): ?>\n      <tr>\n        <td>\n          <div class="product_description">\n          	\n          	<strong><?= $item->product->name ?></strong>\n          </div>\n        </td>\n        <td class="right quantity" id="qty"><input name="item_quantity[<?= $item->key ?>]" value="<?= $item->quantity ?>" type="text"></td>\n        <td class="right" id="price1"><?= format_currency($item->single_price()) ?></td>\n        <td class="right cart_control last" id="price2"> \n          <?= format_currency($item->total_price()) ?>\n          <a title="Remove item" href="#" onclick="return $(this).getForm().sendRequest(''shop:on_deleteCartItem'', \n            {update: {''cart_partial'': ''shop:cart'', ''mini_cart'': ''shop:mini_cart''},\n            confirm: ''Do you really want to remove this item from cart?'',\n            extraFields: {key: ''<?= $item->key ?>''}})" class="remove">Remove</a> \n        </td> \n      </tr>\n    <? endforeach ?>\n  <? else: ?>\n    <tr><td colspan="4" id="cart-empty-message">Your cart is currently empty.  Please fill it first!</td></tr>\n  <? endif ?>\n</tbody>\n\n\n</table>\n \n<input type="submit" class="update btn float_right" value="Update Basket" onclick="return $(this).getForm().sendRequest(''on_action'', {update: {''cart_partial'': ''shop:cart'', ''mini_cart'': ''shop:mini_cart''}});">\n\n \n<a class="button checkout btn" id="cart-checkout-button" value="Checkout" href="<?= root_url(''/checkout'') ?>"><img src="/store/themes/default/resources/images/checkout.png" id="checkout-button-cart"/></a>  \n<p class="post_checkout_btn"><a href="<?= root_url(''/products/book1'') ?>">Continue Shopping</a></p>\n\n', 1, 1, '2013-02-25 22:27:42', '2013-04-18 23:46:42', 'shop;cart', 1),
(3, 'checkout_partial', NULL, '\n\n<?= open_form() ?>\n<?\nswitch ($checkout_step)\n{\ncase ''billing_info'': $this->render_partial(''shop:checkout_billing_info''); break;\ncase ''shipping_info'': $this->render_partial(''shop:checkout_shipping_info''); break;\ncase ''shipping_method'': $this->render_partial(''shop:checkout_shipping_method''); break;\ncase ''payment_method'': $this->render_partial(''shop:checkout_payment_method''); break;\ncase ''review'': $this->render_partial(''shop:checkout_review''); break;\n}\n?>\n</form>', 1, 1, '2013-02-25 22:39:24', '2013-04-18 23:50:58', 'checkout_partial', 1),
(5, 'shop:checkout_billing_info', NULL, '<div id="bill-checkout">\n\n<h3 id="billing-heading">Billing Information</h3>\n<? if ($this->customer): ?>\n<p>Bill to: <strong><?= h($this->customer->name) ?>, <?= $this->customer->email ?></strong>.</p>\n<? endif ?>\n<? if (!$this->customer): ?>\n\n\n	<label for="first_name">First Name</label>\n	<input name="first_name" value="<?= h($billing_info->first_name) ?>" id="first_name" type="text" /><br/>\n	 \n	<div id="last-name-bill"> \n		<label for="last_name">Last Name</label>\n		<input name="last_name" value="<?= h($billing_info->last_name) ?>" id="last_name" type="text" /><br/>\n	</div>\n \n<label for="email">Email</label>\n<input id="email" name="email" value="<?= h($billing_info->email) ?>" type="text" /><br/>\n<? endif ?>\n\n<label for="street_address">Postal Address</label>\n<input id="street_address" name="street_address" type="text" value="<?= h($billing_info->street_address) ?>"/><br/>\n \n<label for="city">City</label>\n<input id="city" type="text" name="city" value="<?= h($billing_info->city) ?>"/><br/>\n\n<div id="phone-bill">\n	<label for="phone">Phone</label>\n	<input id="phone" type="text" value="<?= h($billing_info->phone) ?>" name="phone"/><br/>\n </div>\n \n<label for="zip">Postal Code</label>\n<input id="zip" type="text" name="zip" value="<?= h($billing_info->zip) ?>"/><br/>\n \n<label for="country">Country</label>\n<select id="country" name="country" onchange="return $(''#country'').getForm().sendRequest(\n''shop:on_updateStateList'', {\nextraFields: {''country'': $(''#country'').val(),\n''control_name'': ''state'', ''control_id'': ''state'', ''current_state'': ''<?= $billing_info->state ?>''},\nupdate: {''billing_states'': ''shop:state_selector''}\n})">\n<? foreach ($countries as $country): ?>\n<option <?= option_state($billing_info->country, $country->id) ?>\nvalue="<?= h($country->id) ?>"><?= h($country->name) ?></option>\n<? endforeach ?>\n</select><br/>\n \n\n<input type="hidden" name="checkout_step" value="<?= $checkout_step ?>"/>\n<input type="button" id="submit-billing"  onclick="return $(this).getForm().sendRequest(\n''on_action'',\n{update:{''checkout_page'': ''checkout_partial''}})"/>\n</div>\n\n', 1, 1, '2013-02-25 22:46:30', '2013-04-17 02:23:57', 'shop;checkout_billing_info', 1),
(10, 'shop:product_list', NULL, '<? foreach ($products as $product): ?>\n<li>\n<h3><a href="<?=  $product->page_url(''/product'') ?>"><?= h($product->name) ?></a></h3>\n</li>\n<? endforeach ?>', 1, 1, '2013-02-26 00:45:56', '2013-02-26 00:46:12', 'shop;product_list', 1),
(6, 'shop:checkout_shipping_info', NULL, '<div id="bill-checkout"> \n\n	<h3 id="billing-heading">Shipping Information</h3>\n	<p>Copy <a href="#" onclick="return $(this).getForm().sendRequest(\n	''shop:on_copyBillingInfo'',\n	{update:{''checkout_page'': ''checkout_partial''}})">billing information</a>.<p>\n \n\n	<label for="first_name">First Name</label>\n	<input id="first_name" name="first_name" type="text" value="<?= h($shipping_info->first_name) ?>"/><br/>\n	 \n	<div id="last-name-shipping"> \n		<label for="last_name">Last Name</label>\n		<input id="last_name" name="last_name" type="text" value="<?= h($shipping_info->last_name) ?>"/><br/>\n	</div> \n	 \n	<label for="phone">Phone</label>\n	<input id="phone" type="text" value="<?= h($shipping_info->phone) ?>" name="phone"/><br/>\n	 \n	<label for="street_address">Postal Address</label>\n	<input id="street_address" name="street_address" type="text" value="<?= h($shipping_info->street_address) ?>"/><br/>\n	 \n	<label for="city">City</label>\n	<input id="city" type="text" name="city" value="<?= h($shipping_info->city) ?>"/><br/>\n	 \n	<label for="zip">Zip/Postal Code</label>\n	<input id="zip" type="text" name="zip" value="<?= h($shipping_info->zip) ?>"/><br/>\n	 \n	<label for="country">Country</label>\n	<select id="country" name="country" onchange="return $(''#country'').getForm().sendRequest(\n	''shop:on_updateStateList'', {\n	extraFields: {\n	''country'': $(''#country'').val(),\n	''control_name'': ''state'',\n	''control_id'': ''state'',\n	''current_state'': ''<?= $shipping_info->state ?>''},\n	update: {''shipping_states'': ''shop:state_selector''}\n	})">\n	 \n	<? foreach ($countries as $country): ?>\n	<option <?= option_state($shipping_info->country, $country->id) ?>\n	value="<?= h($country->id) ?>"><?= h($country->name) ?></option>\n	<? endforeach ?>\n	</select><br/>\n	 \n	\n	 \n	<input type="hidden" name="checkout_step" value="<?= $checkout_step ?>"/>\n	<input type="button" id="submit-shipping" value="" onclick="return $(this).getForm().sendRequest(''on_action'', {\n	update:{''checkout_page'': ''checkout_partial''}}\n	)"/>\n</div>\n', 1, 1, '2013-02-25 22:51:05', '2013-04-18 23:51:39', 'shop;checkout_shipping_info', 1),
(7, 'shop:checkout_shipping_method', NULL, '<div id="shipping-method-checkout">\n\n<h3 id="shipping-method-heading">Shipping Method</h3>\n<? if (count($shipping_options)): ?>\n<p id="shipping-method-option">Please select shipping option.</p>\n<? foreach ($shipping_options as $option): ?>\n<? if ($option->multi_option): ?>\n \n<h5><?= h($option->name) ?></h5>\n \n<? if ($option->description): ?>\n<p><?= h($option->description) ?></p>\n<? endif ?>              \n \n<? foreach ($option->sub_options as $sub_option): ?>\n<input <?= radio_state($option->id == $shipping_method->id && $sub_option->id == $shipping_method->sub_option_id) ?>\nid="<?= ''option''.$sub_option->id ?>" type="radio" name="shipping_option" value="<?= $sub_option->id ?>"/>\n<label for="<?= ''option''.$sub_option->id ?>">\n<?= h($sub_option->name) ?> - <strong><?= !$sub_option->is_free ? format_currency($sub_option->quote) : ''free!'' ?></strong>\n</label><br/>\n<? endforeach ?>\n \n<? else: ?>\n \n<input <?= radio_state($option->id == $shipping_method->id) ?> id="<?= ''option''.$option->id ?>"\ntype="radio" name="shipping_option" value="<?= $option->id ?>"/>\n<label  id="shipping-label" for="<?= ''option''.$option->id ?>">\n<strong><?= h($option->name) ?></strong> - <strong><?= !$option->is_free ? format_currency($option->quote) : ''free!'' ?></strong>\n<? if ($option->description): ?>\n<br/><?= h($option->description) ?>\n<? endif ?>\n</label><br/>\n \n<? endif ?>\n<? endforeach ?> \n<input type="hidden" name="checkout_step" value="<?= $checkout_step ?>"/>\n<input type="image" id="next-button-shipping-method" src="/store/themes/default/resources/images/next.png" alt="Next" onclick="return $(this).getForm().sendRequest(\n''on_action'', {update:{''checkout_page'': ''checkout_partial''}})"/>\n<? else: ?>\n<p>There are no shipping options available for your location.</p>\n<? endif ?>\n\n</div>\n\n', 1, 1, '2013-02-25 22:53:20', '2013-04-18 23:53:14', 'shop;checkout_shipping_method', 1),
(8, 'shop:checkout_payment_method', NULL, '<div id="payment-method-checkout">\n\n<h3 id="payment-heading">Payment Method</h3>\n<? if (count($payment_methods)): ?>\n<p>Please select payment method.</p>\n<? foreach ($payment_methods as $method): ?>\n<input <?= radio_state($method->id == $payment_method->id) ?> id="<?= ''method''.$method->id ?>"\ntype="radio" name="payment_method" value="<?= $method->id ?>"/>\n<label id="payment-method-label" for="<?= ''method''.$method->id ?>">\n<?= h($method->name) ?>\n<? if ($method->description): ?>\n<br/><?= h($method->description) ?>\n<? endif ?>\n</label><br/>\n<? endforeach ?>\n<input type="hidden" name="checkout_step" value="<?= $checkout_step ?>"/>\n<input type="button" id="payment-next-button" value="" onclick="return $(this).getForm().sendRequest(\n''on_action'',\n{update:{''checkout_page'': ''checkout_partial''}}\n)"/>\n<? else: ?>\n<p>There are no payment methods available for your location. Please contact our sales department.</p>\n<? endif ?>\n\n</div>\n\n', 1, 1, '2013-02-25 22:55:59', '2013-04-18 23:54:09', 'shop;checkout_payment_method', 1),
(9, 'shop:checkout_review', NULL, '<div id="order-review-checkout">\n\n<h3 id="order-review-heading">Order Review</h3>\n<?\n$bill_to_str = $billing_info->as_string();\n$ship_to_str = $shipping_info->as_string();\n$items = Shop_Cart::list_active_items();\n?>\n \n<p id="billing-info">Bill to:<br /> <?= h($bill_to_str) ?></p>\n<p id="shipping-info">Ship to:<br /> <?= h($ship_to_str) ?></p>\n \n<table id="order-review-table">\n<tr>\n<th id="order-table-cart">Cart Items</th>\n</tr>\n<?\nforeach ($items as $item):\n$options_str = $item->options_str();\n?>\n<tr>\n<td>\n<strong><?= h($item->product->name) ?></strong>\n</td>\n</tr>\n<? endforeach ?>\n</table>\n \n<div id="review-bottom-div"> \n<p>\nSubtotal: <?= format_currency($subtotal) ?><br/>\nDiscount: <?= format_currency($discount) ?><br/>\nShipping: <?= format_currency($shipping_quote) ?>\n \n</p>\n \n<p>Total: <strong><?= format_currency($total) ?></strong></p>\n</div>\n\n<input type="hidden" name="checkout_step" value="<?= $checkout_step ?>"/>\n<input type="button" id="checkout-progress-submit" value="" onclick="return $(this).getForm().sendRequest(\n''on_action'',\n{update:{''checkout_page'': ''checkout_partial''}}\n)"/>\n\n</div>', 1, 1, '2013-02-25 22:57:36', '2013-04-18 23:56:25', 'shop;checkout_review', 1),
(15, 'shop:state_selector', NULL, '<select id="<?= h($control_id) ?>" name="<?= $control_name ?>">\n<? foreach ($states as $state): ?>\n<option <?= option_state($current_state, $state->id) ?> value="<?= h($state->id) ?>"><?= h($state->name) ?></option>\n<? endforeach ?>\n</select>', 1, 1, '2013-04-18 01:04:39', '2013-04-18 01:05:42', 'shop;state_selector', 1),
(11, 'payment:dpspaymentexpress_pxpost', 'Payment form partial', '<?php echo open_form(); ?>\n\n  <?php flash_message(); ?>\n  \n	<ul>\n\n		\n		<li>\n			<?php $field=''cc_number''; ?>\n			<label for="<?php echo $field; ?>">Card Number <span class="req">*</span></label>\n			<input autocomplete="off" id="<?php echo $field; ?>" class="" name="<?php echo $field; ?>" required value="<?php echo h(post($field)); ?>">\n		</li>\n		\n		<li>\n			<?php $field=''cc_mm''; ?>\n			<label for="<?php echo $field; ?>">Card Expiry (MM/YYYY)</label>\n			\n			<?php\n				$curr_year = date(''y'');\n				$years = array();\n				\n				for($i=$curr_year; $i<($curr_year+15); $i++) {\n					$years[]  = $i; }\n			?>\n			<select required="required" name="<?php echo $field; ?>" class="vtiny" class="">\n				<option value="01">01</option>\n				<option value="02">02</option>\n				<option value="03">03</option>\n				<option value="04">04</option>\n				<option value="05">05</option>\n				<option value="06">06</option>\n				<option value="07">07</option>\n				<option value="08">08</option>\n				<option value="09">09</option>\n				<option value="10">10</option>\n				<option value="11">11</option>\n				<option value="12">12</option>\n			</select> &nbsp;/<?php\n			\n				$field=''cc_yy'';\n				\n			?><select required="required" name="<?php echo $field; ?>" class="tiny" class="">\n				\n				<?php foreach($years as $year) : ?>\n					<option value="<?php echo $year; ?>">20<?php echo $year; ?></option>\n				<?php endforeach; ?>\n			</select>\n			\n		</li>\n		\n		<li>\n			<?php $field=''cc_name''; ?>\n			<label for="<?php echo $field; ?>">Name on Card <span class="req">*</span></label>\n			<input autocomplete="off" id="<?php echo $field; ?>" class="" name="<?php echo $field; ?>" required value="<?php echo h(post($field)); ?>" >\n		</li>\n		\n		<li>\n			<?php $field=''cc_csc''; ?>\n			<label for="<?php echo $field; ?>">Card Security Code <span class="req">*</span></label>\n			<input autocomplete="off" id="<?php echo $field; ?>" class="short" name="<?php echo $field; ?>" required value="<?php echo h(post($field)); ?>" >\n		</li>\n	</ul>\n\n\n	<button type="submit" name="submit" id="buy-now-pay" onclick="\n		return $(this).getForm().sendRequest(''shop:on_pay'')">Pay Now</button>\n		\n<?php echo close_form(); ?>', 1, NULL, '2013-02-28 20:45:28', NULL, 'payment;dpspaymentexpress_pxpost', 1),
