INSERT INTO `system_compound_email_vars` (`id`, `code`, `content`, `scope`, `description`) VALUES
(1, 'order_billing_address', '<?= nl2br(h($order->billing_street_addr)) ?>, <?= h($order->billing_city) ?><br/>\n<? if ($order->billing_state): ?>\n  <?= h($order->billing_state->name) ?>, \n<? endif ?>\n<?= h($order->billing_zip) ?>, <?= h($order->billing_country->name) ?>', 'shop:order', 'Outputs a formatted billing address'),
(2, 'order_shipping_address', '<?= nl2br(h($order->shipping_street_addr)) ?>, <?= h($order->shipping_city) ?><br/>\n<? if ($order->shipping_state): ?>\n  <?= h($order->shipping_state->name) ?>,\n<? endif ?>\n<?= h($order->shipping_zip) ?>, <?= h($order->shipping_country->name) ?>', 'shop:order', 'Outputs a formatted shipping address'),
(3, 'order_content', '<? $include_tax = Shop_CheckoutData::display_prices_incl_tax($order); ?>\n<table class="simpleList" style="font: normal 11px/150% Arial, Verdana, sans-serif; width: 100%">\n  <thead style="text-align: left; background: #e5e5e5">\n    <tr>\n      <th>Item</th>\n      <th>SKU</th>\n      <th class="number">Price</th>\n      <th class="number">Discount</th>\n      <th class="number">Quantity</th>\n      <th class="number last">Total</th>\n    </tr>\n  </thead>\n  <tbody style="text-align: left; background: white">\n    <?          \n      $last_index = $items->count-1;\n      foreach ($items as $index=>$item):\n    ?>\n    <tr>\n      <td>\n        <div <? if ($item->bundle_master_order_item_id): ?>style="padding-left: 30px"<? endif ?>>\n          <?= $item->output_product_name() ?>\n        </div>\n      </td>\n      <td><?= $item->product_sku ? h($item->product_sku) : h(''<product not found>'') ?></td>\n      <td class="number"><?= $include_tax ? format_currency($item->price_tax_included) : format_currency($item->single_price) ?></td>\n      <td class="number"><?= $include_tax ? format_currency($item->discount_tax_included) : format_currency($item->discount) ?></td>\n      <td class="number"><?= h($item->get_bundle_item_quantity()) ?></td>\n      <td class="number last">\n        <?           \n          $master_item = $item->get_master_bundle_order_item();\n          $multiplier = ($master_item && $master_item->quantity > 1) ? '' x ''.$master_item->quantity : null;\n        ?>\n        <?= $include_tax ? format_currency($item->bundle_item_total_tax_incl).$multiplier : format_currency($item->bundle_item_total).$multiplier ?>\n      </td>\n    </tr>\n    \n    <? if (($item->bundle_master_order_item_id && $index == $last_index) || ($item->bundle_master_order_item_id && !$items[$index+1]->bundle_master_order_item_id)): \n      $master_item = $item->get_master_bundle_order_item();\n      if ($master_item):\n    ?>\n      <tr style="background: #eee">\n        <td colspan="2"><strong><?= h($master_item->product->name) ?> bundle totals</strong></td>\n        <td class="number"><strong><?= format_currency($master_item->get_bundle_single_price()) ?></strong></td>\n        <td class="number"><strong><?= format_currency($master_item->get_bundle_discount()) ?></strong></td>\n        <td class="number"><strong><?= $master_item->quantity ?></strong></td>\n        <td class="number last"><strong><?= format_currency($master_item->get_bundle_total_price()) ?></strong></td>\n      </tr>\n    <? \n        endif;\n      endif ?>\n    <?\n      endforeach;\n    ?>\n  </tbody>\n</table>', 'shop:order', 'Outputs order items table');
INSERT INTO `system_email_layouts` (`id`, `code`, `content`, `css`, `name`) VALUES
(1, 'system', '<html xmlns="http://www.w3.org/1999/xhtml">\n  <head>\n    <title></title>\n    <meta http-equiv="Content-Type" content="text/html; charset=utf-8"/>\n    <meta http-equiv="Content-Language" content="en-us"/>\n    <style type="text/css" media="screen">\n      <?= $this->css ?>\n    </style>\n  </head>\n  <body>\n    <?= $message ?>\n    <hr/>\n    <p>This is an automatic message. Do not reply to it.</p>\n  </body>\n</html>\n', 'table.simpleList\n{\n  font: normal 11px/150% Arial, Verdana, sans-serif;\n  border-collapse: collapse;\n  width: 100%;\n}\n\ntable.simpleList th, table.simpleList td\n{\n  padding: 0.4em 0.5em;\n  text-align: left;\n  border-right: 1px solid #ddd;\n  vertical-align: top;\n}\n\ntable.simpleList tr td.last,\ntable.simpleList tr th.last\n{\n  border-right: none!important;\n}\n\ntable.simpleList tbody tr:last-child td\n{\n  border-bottom: 1px solid #ccc;\n}\n\ntable.simpleList thead th, table.simpleList thead td\n{\n  background: #e5e5e5;\n  font-weight: normal;\n  color: #000;\n  border-right-color: #d0d0d0;\n  border-top: 2px solid #666;\n  border-bottom: 1px solid #d0d0d0;\n  white-space: nowrap;\n}\n\ntable.simpleList tbody td, table.simpleList tbody th\n{\n  border-bottom: 1px solid #eaeaea;\n  color: #333;\n  background-color: #fff;\n}\n\ntable.simpleList tr.even td, table.simpleList tr.even th\n{\n  background-color: #f5f5f5;\n}\n\ntable.simpleList th.number, table.simpleList td.number, \ntable.simpleList th.float, table.simpleList td.float, \ntable.simpleList th.datetime, table.simpleList td.datetime, \ntable.simpleList th.date, table.simpleList td.date, \ntable.simpleList th.bool, table.simpleList td.bool, \ntable.simpleList th.time, table.simpleList td.time\n{\n  text-align: right!important;\n  white-space: nowrap;\n}\n\n/*\n *\n */', 'System'),
(2, 'external', '<html xmlns="http://www.w3.org/1999/xhtml">\n  <head>\n    <title></title>\n    <meta http-equiv="Content-Type" content="text/html; charset=utf-8"/>\n    <meta http-equiv="Content-Language" content="en-us"/>\n    <style type="text/css" media="screen">\n      <?= $this->css ?>\n    </style>\n  </head>\n  <body>\n    <?= $message ?>\n  </body>\n</html>\n', 'table.simpleList\n{\n  font: normal 11px/150% Arial, Verdana, sans-serif;\n  border-collapse: collapse;\n  width: 100%;\n}\n\ntable.simpleList th, table.simpleList td\n{\n  padding: 0.4em 0.5em;\n  text-align: left;\n  border-right: 1px solid #ddd;\n  vertical-align: top;\n}\n\ntable.simpleList tr td.last,\ntable.simpleList tr th.last\n{\n  border-right: none!important;\n}\n\ntable.simpleList tbody tr:last-child td\n{\n  border-bottom: 1px solid #ccc;\n}\n\ntable.simpleList thead th, table.simpleList thead td\n{\n  background: #e5e5e5;\n  font-weight: normal;\n  color: #000;\n  border-right-color: #d0d0d0;\n  border-top: 2px solid #666;\n  border-bottom: 1px solid #d0d0d0;\n  white-space: nowrap;\n}\n\ntable.simpleList tbody td, table.simpleList tbody th\n{\n  border-bottom: 1px solid #eaeaea;\n  color: #333;\n  background-color: #fff;\n}\n\ntable.simpleList tr.even td, table.simpleList tr.even th\n{\n  background-color: #f5f5f5;\n}\n\ntable.simpleList th.number, table.simpleList td.number, \ntable.simpleList th.float, table.simpleList td.float, \ntable.simpleList th.datetime, table.simpleList td.datetime, \ntable.simpleList th.date, table.simpleList td.date, \ntable.simpleList th.bool, table.simpleList td.bool, \ntable.simpleList th.time, table.simpleList td.time\n{\n  text-align: right!important;\n  white-space: nowrap;\n}\n\n/*\n *\n */', 'External');
INSERT INTO `system_email_templates` (`id`, `code`, `subject`, `content`, `description`, `is_system`, `reply_to_mode`, `reply_to_address`) VALUES
(1, 'shop:registration_confirmation', 'Confirmation', '<p>Dear {customer_name}!</p>\n<p>Thank you for registering. Please use the following email and password to login:<br /> email:&nbsp;{customer_email}<br /> password: {customer_password}</p>', 'This message is sent to a customer after successful registration.', NULL, 'default', NULL),
(2, 'shop:password_reset', 'New password', '<p>Dear {customer_name}!</p><p>Here is your new password for accessing our store: {customer_password}</p>', 'Message to send to a customer after successful password reset.', NULL, 'default', NULL),
(3, 'shop:order_thankyou', 'Thank you for the order!', '<p>Dear {customer_name}!</p><p>Thank you for the order. Your order details:</p><p>Number: {order_id}<br />Date: {order_date}<br />Total: {order_total}</p><p>Order items:</p><p>{order_content}</p>', 'This order is sent to customers on new order.', NULL, 'default', NULL),
(4, 'shop:new_order_internal', 'New order: {order_id}', '<p>This message is to inform you about new order order #{order_id}</p>\n<p><strong>Order details</strong></p>\n<p>Order <strong>#{order_id}</strong>, created on <strong>{order_date}</strong><br /> Subtotal: <strong>{order_subtotal}</strong><br /> Shipping: <strong>{order_shipping_quote}</strong><br /> Tax: <strong>{order_tax}</strong><br /> Discount total: <strong>{cart_discount}</strong><br /> Total: <strong>{order_total}</strong></p>\n<p>Coupon: {order_coupon}</p>\n<p>Customer notes:</p>\n<blockquote>{customer_notes}</blockquote>\n<p><strong>Order items</strong></p>\n<p>{order_content}</p>\n<p><strong>Customer details</strong></p>\n<p>Billing name: {billing_customer_name}<br />Billing address: {order_billing_address}</p>\n<p>Shipping name: {shipping_customer_name}<br />Shipping address: {order_shipping_address}</p>', 'This message is sent to the store team members on new order', 1, 'default', NULL),
(5, 'shop:order_status_update_internal', 'Order status changed: {order_id}', '<p>This message is to inform you that order #{order_id}&nbsp; has changed its status from {order_previous_status} to {order_status_name}. Status transition comment: {order_status_comment}</p>\n<p><strong>Order details</strong></p>\n<p>Order <strong>#{order_id}</strong>, created on <strong>{order_date}</strong><br /> Subtotal: <strong>{order_subtotal}</strong><br /> Shipping: <strong>{order_shipping_quote}</strong><br /> Tax: <strong>{order_tax}</strong><br /> Discount total: <strong>{cart_discount}</strong><br /> Total: <strong>{order_total}</strong></p>\n<p>Coupon: {order_coupon}</p>\n<p>Customer notes:</p>\n<blockquote>{customer_notes}</blockquote>\n<p><strong>Order items</strong></p>\n<p>{order_content}</p>\n<p><strong>Customer details</strong></p>\n<p>Billing name: {billing_customer_name}<br />Billing address: {order_billing_address}</p>\n<p>Shipping name: {shipping_customer_name}<br />Shipping address: {order_shipping_address}</p>', 'This message is sent to the store team members when an order changes its status', 1, 'default', NULL),
(6, 'shop:order_note_internal', 'New order note: {order_note_id}', '<p>Hi!</p>\n<p>User {order_note_author} posted a new order for the order #{order_note_id}:</p>\n<blockquote>{order_note_text}</blockquote>\n<p>You can view or reply to the note on the <a href="{order_note_preview_url}">Order Preview page</a>. Reply to this message to respond {order_note_author} directly by email. If you respond by email, your message will not be added to the order note list.</p>', 'This message is sent to the store team members when somebody posts an order note', 1, 'default', NULL),
(7, 'shop:out_of_stock_internal', 'Product "{out_of_stock_product}" is out of stock', '<p>Hi!</p>\n<p>This message is to inform you that product&nbsp;<strong>{out_of_stock_product}</strong> with SKU <strong>{out_of_stock_sku}</strong> is out of stock. Number of items remaining in stock: <strong>{out_of_stock_count}</strong></p>\n<p>You can update the product stock status on <a href="{out_of_stock_url}">this page</a>.</p>', 'This message is sent to the store team members when a product runs out of stock', 1, 'default', NULL),
(8, 'shop:product_review_internal', 'New review for "{review_product_name}" product', '<p>Hi!</p>\n<p>Visitor {review_author_name} ({review_author_email}) posted a review for the {review_product_name} product:</p>\n<blockquote>{review_text}<br /></blockquote>\n<p>Product rating: {review_rating}</p>\n<p>You can approve or delete the review on <a href="{review_edit_url}">this page</a>.</p>', 'This message is sent to the store team members on new product review', 1, 'default', NULL),
(9, 'shop:auto_billing_report', 'Automated billing report', '<p>Hi!</p><p>LemonStand finished processing the automated billing. Below is a detailed report.</p><p>{autobilling_report}</p>', 'This message is sent to administrators when LemonStand finishes processing the automated billing.', 1, 'default', NULL),
(10, 'shop:low_stock_internal', 'Product "{low_stock_product}" has reached its low stock threshold', '<p>Hi!</p>\n<p>This message is to inform you that product&nbsp;<strong>{low_stock_product}</strong> with SKU <strong>{low_stock_sku}</strong> has reached its low stock threshold. Number of items remaining in stock: <strong>{low_stock_count}</strong></p>\n<p>You can update the product stock status on <a href="{low_stock_url}">this page</a>.</p>', 'This message is sent to the store team members when a product reaches the low stock threshold', 1, 'default', NULL),
(11, 'shop:password_restore', 'Password restore', '<p>Dear {customer_name}!</p>\n<p>Please visit our store within 24 hours to set a new password for your account here: {password_restore_page_link}.</p><p>Thank you</p>', 'Message to send to a customer when they request a password restore.', 0, 'default', NULL),
(12, 'blog:new_comment_notification', 'New Comment', '<p>Dear {comments_subscriber_name}!</p><p>New comment has been added to the LemonStand blog post {post_name_and_url}:</p><p>Author: {comment_author_name}<br />Comment:</p><blockquote>{comment_text}</blockquote><p>To unsubscribe please click the link: {comments_unsubscribe_link}</p>', 'This message is sent to visitors who have subscribed to a blog post new comments notifications.', NULL, 'default', NULL);
